import React from "react";
import Header from "./Header";
import Image from "./Image";



function TitleSection(){
    return(
        <section id="title" className="colored-section">

            <div className="container-fluid">
            <Header />  
                <div className="row">
                    <div className="col-lg-6 ">
                    <h1 className="big-heading">Meet new and interesting dogs nearby.</h1>
                    <button type="button" class="btn btn-dark btn-lg download-btn"><i class="fa-brands fa-apple"></i> Download</button>
                    <button type="button" class="btn btn-outline-light btn-lg download-btn"><i className="fa-brands fa-google-play"></i> Download</button>
                    </div>
                    <div className="col-lg-6">
                    <Image src="images/titleSectionImg.png" alt="iphone-mockup" className="title-image" />
                    </div>
                </div>
            </div>

        </section>
    )
}

export default TitleSection;
